import React from 'react';
import { NavLink } from 'react-router-dom';
//import {Link} from 'react-scroll'
import './header.styles.scss';


const Header = () => (
  <div className='header'>
    <div className='options'>
      <NavLink className='option' to={{pathname:'/#about'}}>
        About
      </NavLink>
      <NavLink className='option' to={{pathname:'/experience'}}>
        Experience
      </NavLink>
      <NavLink className='option' to={{pathname:'/skills'}}>
          Skills
      </NavLink>
      <NavLink className='option' to={{pathname:'/contact'}}>
          Contact Me
      </NavLink>
    </div>
  </div>
);


export default Header;
